  input: TEXT,F3A,,"We have used our best efforts to obtain the information which
    is required by law in connection with the identification of individuals who contribute
    to the campaign committee.  First, when soliciting contributions, we have provided
    potential contributors with a form which includes a clear and conspicuous request
    for the contributor's information and which states that the information is needed
    to comply with federal law.  Second, when the form was not received with a contribution,
    or if the form was incomplete, we have sent the contributor a letter within thirty
    (30) days after receipt of the contribution, along with a copy of the form, asking
    for the form to be completed or for the missing information to be provided, without
    soliciting a further contribution.  In our letter, we have stated that federal
    law requires us to collect and report this information to the FEC.  In each case  in
    which a letter was sent, we have included a pre-addressed envelope for the contributor
    to return the completed form to us.  In some cases, the request for the missing
    information has been sent via e-mail, with the same language as that used in the
    letter, stating that federal law requires us to collect and report the requested
    information.  Third, when the requested information has been received after the
    contribution has been reported, we have filed amendments to the report which originally
    disclosed the contribution."
